import React, { useEffect, useState } from 'react';
import axios from 'axios';

const App = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Substitua com o ID da sua planilha e intervalo de células
    const spreadsheetId = '1dgVHy_i0djzz8ncd1L2zOkzI3qy7YSbT7CvV_BPgXm0';
    const range = 'aba1!A1:D10'; // Ajuste o intervalo conforme necessário
    const apiKey = 'AIzaSyDjQkkzbl0VCCBFMc7sDWliSu6sHAykP3A'; // Sua chave de API

    // Fazendo a requisição à API do Google Sheets
    axios.get(`https://sheets.googleapis.com/v4/spreadsheets/${spreadsheetId}/values/${range}?key=${apiKey}`)
      .then(response => {
        const sheetData = response.data.values;
        setData(sheetData); // Armazena os dados na variável de estado
      })
      .catch(error => {
        console.error('Erro ao buscar dados da planilha:', error);
      });
  }, []);

  return (
    <div>
      <h1>Dados da Planilha</h1>
      <table>
        <thead>
          <tr>
            <th>Coluna 1</th>
            <th>Coluna 2</th>
            <th>Coluna 3</th>
            <th>Coluna 4</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            <tr key={index}>
              {row.map((cell, cellIndex) => (
                <td key={cellIndex}>{cell}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default App;
